import React, { useState } from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faSeedling } from '@fortawesome/free-solid-svg-icons'

import { Link } from 'react-router-dom';

import { useCookies } from "react-cookie";
import axios from "axios";

function ButtonProfile(props){
    const [logedin, setLogedin ] = useState(true)
    const [cookies] = useCookies(['name']);

    axios.post("http://localhost:5000/secured/user", {token: cookies.token})
    .then(response =>{
        setLogedin(true);
    })
    .catch(error => {
        setLogedin(false);
    })
    
    if(logedin){
    return(
            <Link to="/editp" ><input type={props.typeCustom} value={ <React.Fragment> <FontAwesomeIcon icon={faSeedling}/> </React.Fragment> } class={props.w3classprops}></input></Link>
        );
    }
}

export default ButtonProfile;
